export const LOGO = {
  src: `${process.env.APP_DOMAIN}/static/img/avatar2.png`,
  alt: "Inminemine logo",
  class: "brand-image img-circle elevation-3",
  style: { opacity: ".8" }
};

export const LOGO_TITLE = {
  label: "IN_MY_MINE"
};
